;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,0,0,0,0,0,'textmedia','','','<h3>Willkommen im virtuellen Kartenforum</h3>\r\n<p>Das Virtuelle Kartenforum 2.0 wurde 2014 im Rahmen des gleichnamigen DFG Projektes durch die Sächsische Landesbibliothek – Staats- und Universitätsbibliothek Dresden (SLUB) und den Lehrstuhl für Geodäsie und Geoinformatik der Universität Rostock entwickelt. Es bietet einen Zugriff auf große Teile der historischen Kartensammlung der SLUB und ermöglicht den Nutzern die Georeferenzierung der Historischen Karten.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0),(25,NULL,5,1637763627,1637763461,1,0,0,0,0,'',512,0,0,0,0,NULL,0,'a:7:{s:5:\"CType\";N;s:6:\"colPos\";N;s:11:\"pi_flexform\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;}',0,0,0,0,0,0,0,'slubwebkartenforum_apps','','',NULL,0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"settings.importApp\">\n                    <value index=\"vDEF\">ProgressBar</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>','',0,'',NULL,'','',NULL,124,0,0,0,0,0),(26,NULL,11,1637771852,1637771852,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'',0,0,0,0,0,0,0,'slubwebkartenforum_apps','','',NULL,0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"settings.importApp\">\n                    <value index=\"vDEF\">UserHistory</value>\n                </field>\n            </language